import React from 'react';
import './CircularSkillBar.css';

const CircularSkillBar = ({ percentage, text }) => {
  return (
    <div className="circular-skill-bar">
      <div className="circular-skill-bar-progress">
        <div
          className="circular-skill-bar-fill"
          style={{ transform: `rotate(${(100 / 100) * 360}deg)` }}
        ></div>
      </div>
      <div className="circular-skill-bar-text">
        {text}
      </div>
    </div>
  );
};

export default CircularSkillBar;
